(function () {
	var currentIterationNode = routesService.getDocumentCurrentIteration(stm_document),
		stageItems,
		employees,
		recipients = [],
		i,
		documentLink,
		msg;
	if (currentIterationNode) {
		stageItems = search.query({
			query: 'TYPE:"lecmWorkflowRoutes:stageItem" AND PATH:"' + currentIterationNode.qnamePath + '//*"',
			language: 'fts-alfresco'
		});
		for (i in stageItems) {
			employees = stageItems[i].assocs['lecmWorkflowRoutes:stageItemEmployeeAssoc'];
			if (employees && employees.length) {
				recipients.push(employees[0].nodeRef.toString());
			}
		}
		documentLink = documentScript.wrapperDocumentLink(stm_document, '{lecm-document:present-string}');
		msg = 'Документ ' + documentLink + ' был возвращен на доработку автором документа.';
		notifications.sendNotification(recipients, msg, stm_document);
	}
})();

(function() {
    var assoc, msg;
    stm_document.properties['lecmSignAspects:isSigned'] = true;
    stm_document.properties['lecmSignAspects:signingState'] = 'COMPLETE';
    stm_document.properties['lecmSignAspects:signingDate'] = base.getValueConverter().convertValueForJava(new Date());
    stm_document.save();
    assocs = stm_document.assocs['lecmSignAspects:signerEmployeeAssoc'];
    if (assocs && assocs.length) {
        stm_document.removeAssociation(assocs[0], 'lecmSignAspects:signerEmployeeAssoc');
    }
    stm_document.createAssociation(orgstructure.getCurrentEmployee(), 'lecmSignAspects:signerEmployeeAssoc');

    msg = "#initiator подписал(а) документ " + documentScript.wrapperDocumentLink(stm_document, "{lecm-document:ext-present-string}");
    businessJournal.log(stm_document.nodeRef.toString(), "SIGNING", substitude.formatNodeTitle(stm_document.nodeRef.toString(), msg), []);
})();

/* направить на регистрацию */
(function(){
    var i,
        outgoing = stm_document, /* исходящий документ */
        registrars = edsGlobalSettings.getRegistrars("DA_REGISTRARS", outgoing), /* получение списка регистраторов по документу */
        registrarsCount = registrars.length,
        notification;
    /* раздаем права регистраторам */
    for(i = 0; i < registrarsCount; ++i) {
        statemachine.grandDynamicRoleForEmployee(outgoing, registrars[i], "DA_REGISTRAR_DYN", task);
    }
    /* подготавливаем уведомление */
    notification = outgoingStatemachine.prepareNotificationAboutRegistration(outgoing, registrars);
    /* рассылаем уведомление */
    notifications.sendNotification(notification);
})();

var outgoing = stm_document;

var logText = "#initiator направил(а) документ " + documentScript.wrapperDocumentLink(outgoing, "№ {~REGNUM}") + " на регистрацию";
logText = substitude.formatNodeTitle(outgoing.nodeRef.toString(), logText);
businessJournal.log(outgoing.nodeRef.toString(), "DIRECT_DOCUMENT", logText, []);

/* Зарегистрировать документ */
(function() {
    var outgoing = stm_document;
    regnumbers.registerDocument(outgoing, "OUTGOING_DOC_NUMBER");
    outgoing.save();
})();

/* уведомить об отправке */
